Series V: Addendum, is comprised mostly of material donated by the union in 2006 after its headquarters was moved from 25 West 43rd St. in New York City. The series consists of six sub-series, as follows: 
A. Minutes, 1970-2004, including minutes of Delegate Assembly and Executive Council meetings; 
B. Correspondence, 1976-2000, including incoming and outgoing correspondence of Frank Annunziato, Barbara Bowen, Arnold Cantor, and Irwin Polishook; 
C. Bargaining Files, 1969-1995; 
D. City University of New York (CUNY), Budget and General Files, 1973-1999, including incoming and outgoing correspondence with CUNY officials, reports, budget materials, clippings and publicity material covering all aspects of the PSC's relationship with the CUNY system; 
E. Clarion Files, 1974-2000, including drafts of articles, editorial correspondence and background materials used in the production of the union's newspaper; 
F. General Files, 1957-2004, comprised of subject files on topics, organizations, persons and issues of concern to the union. Also included in this series are the files of the Belle Zeller Scholarship Fund, files on the PSC's relations with the American Association of University Professors (AAUP) and with the American Federation of Teachers, and extensive files documenting the activities of PSC chapters on the many campuses of the CUNY system.
